@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'Enjoying-Cooking';

}
<h1>{{title}}</h1>
<nav>
  <a routerLink="/">Home</a>
  <a routerLink="/partners">Partners</a>
  <a routerLink="/cookings">My cookings</a>
  <a routerLink="/about">About us</a>
  <button routerLink="authorization" style="width: 150px; height: 50px;">Account</button>
</nav>
<router-outlet></router-outlet>

<app-footer></app-footer>
